【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 食材処理を極める無段階スピード調節。<br />毎分800回転から3000回転まで無段階にスピードが調節できるため、<br />粗みじんから滑らかな練り仕上げまで思いのままに食材が仕上げられます。<br /><br />★ 食材の素材を生かした調理ができる、断続/連続運転切り替えスイッチ付き。<br />より食材に合わせた調理を運転の切り替え(断続/連続)にて、実現。<br />食材の特性(固い・柔らかい・乾燥物・水分が多い等)や、食材の形状に合わせ、<br />やさしく・力強く人間が包丁で調理したように均一な状態に仕上げます。<br /><br />★ DCモータが生み出す静音性。<br />高性能DCモータをブレードに直結させるダイレクトドライブが、かつてない静音性を生み出します。<br /><br />★ 2つのパーツで7役をこなします。<br /> 「きざむ」「する」「まぜる」「くだく」「あわだてる」「こねる(ブレード)」「おろす(グレーター)」の1台7役。<br /><br />★ 制約が少ない多様な食材処理。<br />多くのフードプロセッサーで禁止食材とされる氷やハードチーズ、コーヒー豆などの固い食材、<br />山芋や納豆などの粘りのある食材、少量に限定される液体など多様な食材処理が行なえます。<br /><br />★ 軽量・頑丈・清潔なステンレス製ワークボウル。<br />ガラスの様に重くなくプラスチックの様に傷つかない、食材処理用ボウルとして最も信頼性の高い<br />ステンレスをワークボウルに使用しております。<br /><br />★ 定番料理から高度料理まで、簡単に楽しく調理できるレシピブック付き。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 容量(一回に調理できる最大量): 500g(ハンバーグの場合)、500ml(ジュースの場合)<br />* 本体サイズ(約): 幅21.0×奥行16.0×高さ25.0cm<br />* 重量: 約3.1kg<br />* 消費電力: 140W<br />* 定格時間: 20分(フードプロセッサー使用時)、1分(液体使用時)<br />* コード長: 約2.0m<br />* 付属品: スパチュラ、グレーター、ウェットパッキン、取扱説明書(保証書付き)、レシピブック</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
